const groceriesList = () => {
  const groceryMap = new Map();
  groceryMap.set('Apples', 5);
  groceryMap.set('Bananas', 3);
  groceryMap.set('Milk', 1);
  groceryMap.set('Bread', 2);
  groceryMap.set('Eggs', 6);

  return groceryMap;
};


export default groceriesList;
